import { Stage, Layer, Rect } from 'react-konva';

function Main() {
    return (
      <div>
        <Stage width={window.innerWidth} height={window.innerHeight}>
          <Layer>
            <Rect
              x={20}
              y={20}
              width={100}
              height={100}
              fill="white"
              shadowBlur={10}
            />
          </Layer>
        </Stage>
      </div>
    );
  }

export default Main;
